const Part = ({name, exercises}) => {
    return (
        <li>
            <p>{name}</p>
            <p>{exercises}</p>
        </li>
    )
}

const Header = ({name}) => {
    return (
        <>
            <h2>{name}</h2>
        </>
    )
}

const Content = ({parts}) => {
    return (
        <>
            <ul>
                {parts.map(part => <Part key={part.id}/>)}
            </ul>
        </>
    )
}

const Course = ({course}) => {
    return (
        <>
            <Header course={course.name}/>
            <Content parts={course.parts}/>
        </>
    )
}

export default Course
